package Resources

import "encoding/base64"

// getByteFile returns a byte array that represents a base64 encoded file
func getByteFile(fileInB64 string) []byte {
	file, err := base64.StdEncoding.DecodeString(fileInB64)
	if err != nil {
		return nil
	}

	return file
}

